import React from "react";
import { Route, BrowserRouter, Routes } from "react-router-dom";
import Listeencheres from "./components/Listeencheres";
import Historique from './components/Historique';
import Ficheenchere from './components/Ficheenchere';
import Formulaire from './components/Formulaire';



function App({ children }) {
  return (
    <div className="App">
      <BrowserRouter>
        <Routes>
          <Route exact path="/" component={Listeencheres} />
          <Route exact path="/about" component={Historique} />
          <Route exact path="/contact" component={Ficheenchere} />
        </Routes>
      </BrowserRouter>
    </div >
  );
};

export default App;
